import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Chat  from './Chat';
import ChatBot from 'react-simple-chatbot';

<ChatBot
  steps={[
    {
      id: 'hello-world',
      message: 'Hello World!',
      end: true,
    },
  ]}
/>
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
ReactDOM.render(
  <React.StrictMode>
    <Chat />
  </React.StrictMode>,
  document.getElementById('suporte')
);

